import styled from 'styled-components'
import { Link } from 'react-router-dom';

export const HeaderContainer = styled.div`
        width:100%;
        height:70px;
        display:flex;
        justify-content: space-between;
`;

export const LogoContainer = styled(Link)`
        height:100%;
        width:70px;
        padding:25px;
`;
